    <p>{`Für unser erstes Experiment haben wir ein Google Colab Notebook erstellt mit dem wir uns mit unserer elasticsearch instanz verbunden und versucht haben verschiedene Suchanfragen über elasticsearch miteinander zu vergleichen. Hierbei wird vorerst nur auf die elsaticsearch interne Mittel zurück gegriffen, sowie das verändern der Suchparameter match und query, sowie den internen stemmern. Der gesamte Code ist in Python geschrieben`}</p>
    <p>{`Um das Experiment zu starten haben wir zuerst diese 5 freiverfügbaren corpora geparst. Wie wir das gemacht haben seht ihr in unserem Guide How-to-Parse oder indem ihr euch die einzelnen Notebooks unseres Parsings genauer anschaut.`}</p>
    <p>{`Anschließend haben wir die geparsten Daten an die Ranking API von elasticsearch übergeben und mittels kleiner Änderungen verschiedene Werte erhalten.`}</p>
    <p>{`For our first experiment on how to influence the build-in search metrics we compared the
(`}<a parentName="p" {...{
        "href": "https://pragmalingu.de/docs/guides/basic-definitions#stemming"
      }}>{`Read about stemming in general`}</a>{`) `}</p>
    <p>{`We connected to our elasticsearch instance with a Google CoLab Notebook using Python code.`}</p>
    <p>{`Therefore we parsed `}<a parentName="p" {...{
        "href": "http://ir.dcs.gla.ac.uk/resources/test_collections/"
      }}>{`this 5 free available corpora`}</a>{` hosted by the University of Glasgow and feed them to the elasticsearch `}<a parentName="p" {...{
        "href": "https://www.elastic.co/guide/en/elasticsearch/reference/current/search-rank-eval.html"
      }}>{`Ranking API`}</a>{`. With `}<a parentName="p" {...{
        "href": "https://pragmalingu.de/docs/guides/how-to-parse"
      }}>{`our parsing guide`}</a>{` you can try this yourself or you can look at our `}<a parentName="p" {...{
        "href": ""
      }}>{`Data Set Notebooks.`}</a>{` `}</p>
    <p>{`We looked at the following parameters:`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://www.elastic.co/guide/en/elasticsearch/reference/current/query-dsl-match-query.html"
        }}>{`Match query`}</a>{` `}</li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://www.elastic.co/guide/en/elasticsearch/reference/current/query-dsl-simple-query-string-query.html"
        }}>{`Simple query string`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://www.elastic.co/guide/en/elasticsearch/reference/current/analysis-stemmer-tokenfilter.html"
        }}>{`Standard english stemmer provided by elasticsearch`}</a></li>
    </ul>
    <h2 {...{
      "id": "match-operator"
    }}>{`Match operator`}</h2>
    <p>{`Der `}<a parentName="p" {...{
        "href": "https://www.elastic.co/guide/en/elasticsearch/reference/current/query-dsl-match-query.html"
      }}>{`match query operator`}</a>{` ist die standard Einstellung mit deren man bei elasticsearch eine full-text search durchführt. Dabei wird versucht die eingegebene Suchanfrage fuzzy zu matchen. `}</p>
    <p>{`Diese Suchanfrage nimmt unsere eingegebene query und sucht sie im Textfeld unserer Dokumente. Dabei wird eine standard tokenisierung und analyse des textes durchgeführt.`}</p>
    <p>{`Here you can see a request with the match query operator from the medline corpus as an example:`}</p>
    <pre><code parentName="pre" {...{}}>{`"request": {
                "query": {
                    "match": {
                        "text": "palliation (temporary improvement) of cancer patients by using drugs, x-ray, surgery."
                    }
                }
            }
        },
`}</code></pre>
    <h2 {...{
      "id": "simple-query-operator"
    }}>{`Simple query operator`}</h2>
    <pre><code parentName="pre" {...{}}>{`"request": {
                "query": {
                    "simple_query_string": {
                        "fields": [
                            "title",
                            "text"
                        ],
                        "query": "palliation (temporary improvement) of cancer patients by using drugs, x-ray, surgery."
                    }
                }
            }
        },
`}</code></pre>
    <h2 {...{
      "id": "stemming"
    }}>{`Stemming`}</h2>
    <pre><code parentName="pre" {...{}}>{`#create the correct settings 
settings = {
    "settings": {
        "number_of_shards": 1,
        "number_of_replicas": 0,
        "analysis": stemming_analyser
    }
}

stemming_prefix = "stemming-"
`}</code></pre>
    <pre><code parentName="pre" {...{}}>{`#the order of filter and analyser is arbitrary
stemming_analyser = {
    "filter" : {
        "eng_stemmer" : {
        "type" : "stemmer",
        "name" : "english"
        }
    },
    "analyzer" : {
        "default" : {
            "tokenizer" : "standard",
            "filter" : ["lowercase", "eng_stemmer"]
        }
    }
}
`}</code></pre>
    <h2 {...{
