    <p>{`This are the results without any further processing than the parsing, which can be retraced in `}<a parentName="p" {...{
        "href": "https://pragmalingu.de/docs/guides/how-to-parse"
      }}>{`our parsing guide`}</a>{`:`}</p>
    <table>
